// src/pages/PetDetails.jsx
import React, { useEffect, useState } from 'react';
import { useParams, useNavigate, Link } from 'react-router-dom';
import api from '../services/api';

export default function PetDetails() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [pet, setPet] = useState(null);
  const [form, setForm] = useState({});
  const [editando, setEditando] = useState(false);

  useEffect(() => {
    api.get(`/pets/${id}`).then((res) => {
      setPet(res.data);
      setForm(res.data);
    });
  }, [id]);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setForm((prev) => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value,
    }));
  };

  const handleUpdate = async (e) => {
    e.preventDefault();
    try {
      await api.put(`/pets/${id}`, {
        ...form,
        idade: Number(form.idade),
        peso: Number(form.peso),
      });
      setEditando(false);
      navigate('/pets');
    } catch (err) {
      alert('Erro ao atualizar pet');
    }
  };

  const handleDelete = async () => {
    if (window.confirm('Tem certeza que deseja excluir este pet?')) {
      await api.delete(`/pets/${id}`);
      navigate('/pets');
    }
  };

  if (!pet) return <p>Carregando...</p>;

  return (
    <div className="container my-5">
      <h2>Detalhes do Pet</h2>
      <Link to="/pets" className="btn btn-secondary mb-3">← Voltar</Link>

      {editando ? (
        <form onSubmit={handleUpdate}>
          <div className="mb-3">
            <label className="form-label">Nome</label>
            <input name="nome" className="form-control" value={form.nome} onChange={handleChange} />
          </div>

          <div className="mb-3">
            <label className="form-label">Espécie</label>
            <input name="especie" className="form-control" value={form.especie} onChange={handleChange} />
          </div>

          <div className="mb-3">
            <label className="form-label">Raça</label>
            <input name="raca" className="form-control" value={form.raca} onChange={handleChange} />
          </div>

          <div className="mb-3">
            <label className="form-label">Idade</label>
            <input name="idade" type="number" className="form-control" value={form.idade} onChange={handleChange} />
          </div>

          <div className="mb-3">
            <label className="form-label">Peso (kg)</label>
            <input name="peso" type="number" className="form-control" value={form.peso} onChange={handleChange} />
          </div>

          <div className="mb-3">
            <label className="form-label">Porte</label>
            <input name="porte" className="form-control" value={form.porte} onChange={handleChange} />
          </div>

          <div className="mb-3">
            <label className="form-label">Sexo</label>
            <input name="sexo" className="form-control" value={form.sexo} onChange={handleChange} />
          </div>

          <div className="mb-3">
            <label className="form-label">Cor</label>
            <input name="cor" className="form-control" value={form.cor} onChange={handleChange} />
          </div>

          <div className="form-check mb-3">
            <input className="form-check-input" type="checkbox" name="castrado" checked={form.castrado} onChange={handleChange} />
            <label className="form-check-label">Castrado</label>
          </div>

          <button type="submit" className="btn btn-primary">Salvar</button>
        </form>
      ) : (
        <div>
          <p><strong>Nome:</strong> {pet.nome}</p>
          <p><strong>Espécie:</strong> {pet.especie}</p>
          <p><strong>Raça:</strong> {pet.raca}</p>
          <p><strong>Idade:</strong> {pet.idade} anos</p>
          <p><strong>Peso:</strong> {pet.peso} kg</p>
          <p><strong>Porte:</strong> {pet.porte}</p>
          <p><strong>Sexo:</strong> {pet.sexo}</p>
          <p><strong>Cor:</strong> {pet.cor}</p>
          <p><strong>Castrado:</strong> {pet.castrado ? 'Sim' : 'Não'}</p>

          <button className="btn btn-warning me-2" onClick={() => setEditando(true)}>Editar</button>
          <button className="btn btn-danger" onClick={handleDelete}>Excluir</button>
        </div>
      )}
    </div>
  );
}
